import { useParams } from 'react-router-dom';

function Bookingscreen({match}){
    let roomid = useParams();
    console.log($roomid);
    return (
        <div>
            <h1>Booking Screen</h1>
            <h1>Room Id = {match.params.roomid}</h1>
        </div>
    )
}

export default Bookingscreen
